import React, { Component } from 'react';

class TopNav extends Component {
  render() {
    return(
      <nav>
        <ul>
          <li>Home</li>
          <li>Other</li>
          <li>Other2</li>
        </ul>
      </nav>
    );
  }
}

export default TopNav;
